INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "お！\nあそこに困ってそうな人発見！", 0, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1.4, "春咲 ひより", 1, 1001, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "大切な人を\n守れるようになりたい…って", 0, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1.4, "草野 優衣", 1, 1002, "みんなみたいに\nわたしも強くならなきゃ");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "キミに必要な集中力と感性が", 0, 1, "少しは磨かれると思いますよ。", 0, 1.4, "士条 怜", 1, 1003, "フェンシングを始めてみては？");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "今日はなにして遊ぶ？", 0, 1, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1.5, "穂高 みそぎ", 1, 1004, "ねぇ、にいちゃん！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "ねぇ…", 0, 1, "私といっしょに…\nいかない？", 0, 1.4, "風宮 あかり", 1, 1006, "風宮あかりです");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "プリンたべたいのー", 0, 1, "食べ物の恨みは怖いのー", 0, 1.5, "出雲 宮子", 1, 1007, "出雲宮子なのー");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, "いいよ。\n見られることは運命さ…", 0, 1.4, "虹村 雪", 1, 1008, "ボクは虹村雪。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, "人呼んで「疾風の冥姫」!!", 0, 1.4, "柊杏奈", 1, 1009, "フッ…聞いて後悔するがいい！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, "ほんまおおきにやわ～♪", 0, 1.5, "姫宮 真歩", 1, 1010, "マホマホ王国のプリンセス、\nまほ姫どす");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, "ここで会ったが\n100年目～！", 0, 1.4, "衣之咲 璃乃", 1, 1011, "衣之咲璃乃です！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "ち、超能力って…\n何のことかな～？", 0, 1, "…って、お願い！\n誰にも言わないでおいて～！", 0, 1.4, "柏崎 初音", 1, 1012, "私はハツネ、\n結構強いんだよ。\nきらーん☆");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "一応カリスマ読モJKやってまっす！", 0, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1.4, "美波 鈴奈", 1, 1016, "ちょす！\n美波鈴奈だよ～♪");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "東京は遊園地みたいなところさー", 0, 1, "でも、沖縄もとってもいいとこさー", 0, 1.4, "喜屋武 香織", 1, 1017, "はいたーい。\n喜屋武香織さー。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "先生って呼ばれるのは\nくすぐったいから", 0, 1, "イオちゃんって呼んでね。", 0, 1.4, "支倉 伊緒", 1, 1018, "支倉伊緒です。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, "ミミをおいてかないでぇ～", 0, 1.5, "茜 ミミ", 1, 1020, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "あの……\nふぇ……", 0, 1, "ふぇぇぇぇぇん……", 0, 1.5, "栗林 くるみ", 1, 1021, "あ…あの…えっと…\n栗…林…くるみ…です……");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "こんな私に貴重な時間を\n割いていただき、", 0, 1, "なんてありがとうございます！", 0, 1.4, "風宮 より", 1, 1022, "風宮よりです。\nあああああ！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "おにいちゃんどこいくの？\nえ？", 0, 1, "私こっち行きたいー\nね、早く早くー", 0, 1.5, "北条 綾音", 1, 1023, "私、アヤネ！\nぷうきちと一緒についてってあげるね！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, "これて何か違う…\nあああすみません！", 0, 1.4, "天野 すずめ", 1, 1025, "わっ…わっ…私、\n天野すずめといいます！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "あなたは…運命の……\n伴侶……", 0, 1, "離しませんわ………\n絶対に…!!", 0, 1.4, "倉石 恵理子", 1, 1027, "……クスクス…私は\n…倉石恵理子……");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, "…そうでしょ？？", 0, 1.4, "佐々木 咲恋", 1, 1028, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, "あはは、\n私もまだまだだなぁ～", 0, 1.4, "桜井 望", 1, 1029, "桜井望だよ！\nよろしくねっ");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1.4, "ニノン・ジュベール", 1, 1030, "デケデケデンっ！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, "おかしいですね……", 0, 1.4, "上喜 しのぶ", 1, 1031, "上喜しのぶです。\n手元のドクロが父です。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "けんども\nそれには足りないモンが…", 0, 1, "そう、\nオラのボケに突っ込める相方が…！", 0, 1.5, "野戸まひる", 1, 1033, "目指すはビッグな\nお笑い芸人だっぺ！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "ちょっと緊張しちゃって…", 0, 1, "ちょ\nちょっと一杯飲んできます…！", 0, 1.4, "綾瀬 ゆかり", 1, 1034, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "知らない人とは話しちゃいけないので", 0, 1, "これ以上お話しすることは…\nないです！", 0, 1.5, "氷川 鏡華", 1, 1036, "氷川鏡華…です");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "……あ、アラーム。", 0, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1.4, "柏崎 栞", 1, 1038, "柏崎…栞です。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "私、一人も友達がいなくて……", 0, 1, "野に咲く花が、\n唯一の話相手です。", 0, 1.4, "双葉 碧", 1, 1040, "ふ、双葉碧です。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1, "そう思っています。", 0, 1.4, "三角 千歌", 1, 1042, "三角千歌です。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "あぁ？\nお前のそいつの仲間か？", 0, 1, "う、疑ってすまなかったな…", 0, 1.4, "安芸 真琴", 1, 1043, "安芸真琴だ。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "生けとし生ける全ての者よ！", 0, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1.4, "イリヤ・オーンスタイン", 1, 1044, "わらわこそは夜を総べる者！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "ぐふふふふ……はっ！", 0, 1, "ｌク、クウカに何かご用ですか!?", 0, 1.4, "遠見 空花", 1, 1045, "そこで騎士は妖精を乱暴に……");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1.4, "宮坂たまき", 1, 1046, "宮坂たまきにゃ♪\n猫はいいにゃよ？");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "それでは早速クエストに…", 0, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1.4, "大神 美冬", 1, 1048, "大神美冬よ！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "クエストもバトルも\n掃除も洗濯も", 0, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1.4, "星野静流", 1, 1049, "星野静流だよ！");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "見ての通りの\nセクシー美少女で", 0, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1.5, "玉泉美咲", 1, 1050, "アタシは玉泉美咲。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "？？？？", 0, 1, "？？？？", 0, 1.4, "リマ", 1, 1052, "？？？");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, "そ、そこまでいうなら\nもらってやる", 0, 1.5, "モニカ・ヴァイスヴィント", 1, 1053, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, "そ、そこまでいうなら\nもらってやる", 0, 1.5, "ペコリーヌ", 1, 1058, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, "そ、そこまでいうなら\nもらってやる", 0, 1.5, "コッコロ", 1, 1059, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, 2, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, "そ、そこまでいうなら\nもらってやる", 0, 1.5, "キャル", 1, 1060, "モニカ・ヴァイスヴィントだ。");
